const ADD_MESSAGE = 'ADD-MESSAGE';
const UPDATE_NEW_MESSAGE_TEXT = 'UPDATE-NEW-MESSAGE-TEXT';

let initialState = {
    dialogs: [
        {id: 1, name: 'Dimych', ava: "data:image/jpeg;base64,"},
        {id: 2, name: 'Andrew', ava: "data:image/jpeg;base64,"},
        {id: 3, name: 'Sveta', ava: "data:image/jpeg;base64,"},
        {id: 4, name: 'Sasha', ava: "data:image/jpeg;base64,"},
        {id: 5, name: 'Viktor', ava: "data:image/jpeg;base64,"},
        {id: 6, name: 'Valera', ava: "data:image/jpeg;base64,"}
    ],
    messages: [
        {id: 1, message: 'Hi', isAuthorMe: false},
        {id: 2, message: 'How is your it course?', isAuthorMe: true},
        {id: 3, message: 'Yo', isAuthorMe: false},
        {id: 4, message: 'Yo', isAuthorMe: true},
        {id: 5, message: 'Yo', isAuthorMe: false}
    ],
    newMessageText: ''
}

const dialogsReducer = (state = initialState, action) => {

    switch (action.type) {
        case ADD_MESSAGE: {
            let newMessage = {
                id: 6,
                message: state.newMessageText,
                isAuthorMe: true
            }

            let stateCopy = {...state}
            stateCopy.messages = [...state.messages]
            stateCopy.messages.push(newMessage);
            stateCopy.newMessageText = '';
            return stateCopy
        }
        case UPDATE_NEW_MESSAGE_TEXT: {
            let stateCopy = {...state}
            stateCopy.newMessageText = action.newText;
            return stateCopy
    }
        default:
            return state
    }
}

export const addMessageActionCreator = () => ({type: ADD_MESSAGE})

export const updateNewMessageTextActionCreator = (text) => ({
    type: UPDATE_NEW_MESSAGE_TEXT, newText: text
})

export default dialogsReducer